import styled from 'styled-components'

const Ul = styled.ul`
  list-style: none;
  display: flex;
  flex-flow: row nowrap;

  li {
    padding: 18px 10px
  }

  @
`

const RightNav = () => {
    return (
        <Ul>
        <li>Home</li>
        <li>SignUp</li>
        <li>login</li>
        <li>Search</li>
        <li>About</li>
      </Ul>
    )
}

export default RightNav;
